import React from "react";
import playerImage from "../images/cowboy.png"; 

const Player = () => {
  return (
    <svg className="player" width="100%" height="100%">
      {/* You can define your SVG here */}
      {/* <circle r="5" fill="red" /> */}
      <image href={playerImage} width="100%" height="100%"
      style ={{ objectFit: "cover"}}
       />
    </svg>
  );
};

export default Player;
